using namespace std;
using namespace std::chrono;

int maxVowels(string s, int k)
{
    int novo=0, max=0;
    cout<<"\nj from "<<0<<" to "<<k-1<<endl;
    for(int j = 0; j<k; j++)
    {
        // cout<<"\nStarting from j index: "<<j<<endl;
        if(s[j]=='a' || s[j]=='e' || s[j]=='i' || s[j]=='o' || s[j]=='u')
        {
            cout<<"\nNew vowel j at:"<<s[j]<<endl;
            novo++;
            max++;
        }
    }
    cout<<"\ni from "<<1<<" to "<<s.size()-k-1<<endl;
    for(int i=1; i<s.size()-k; i++)
    {
        // for(int j = i; j<i+k; j++)
        // {
        //     // cout<<"\nStarting from j index: "<<j<<endl;
        //     if(s[j]=='a' || s[j]=='e' || s[j]=='i' || s[j]=='o' || s[j]=='u')
        //     {
        //         novo++;
        //     }
        // }
        if(s[i+k-1]=='a' || s[i+k-1]=='e' || s[i+k-1]=='i' || s[i+k-1]=='o' || s[i+k-1]=='u')
        {
            cout<<"\nNew vowel i at: "<<s[i+k-1]<<endl;
            novo++;
        }

        if(s[i]=='a' || s[i]=='e' || s[i]=='i' || s[i]=='o' || s[i]=='u')
        {
            cout<<"Vowel removed at: "<<s[i]<<endl;
            novo--;
        }

        if(novo>max)
        {
            string sub = s.substr(i,k);
            cout<<"\nMax string: "<<sub<<endl;
            max = novo;
        }
    }
    return max;
}

int main()
{
    auto start = high_resolution_clock::now();
    string s = "novowels";
    // string s = "";
    // int k = 3945;
    int k = 1;
    int sol = maxVowels(s, k);

    cout<<"\nMax Vowels: "<<sol<<endl;

    auto stop = high_resolution_clock::now();
    auto duration = duration_cast<microseconds>(stop - start);
    cout <<"\nExecution time: "<<duration.count() <<" microseconds"<<endl;
    return 0;
}